#include "tools.h"

bool isImprisoned();
void escape();
void clearCoinsFromFolder(string path, bool recursive);
void printTalk();
void printLook();
void printMan();

string getMirrorIntList();

int main(int argc, const char * argv[]) {
    
    if (argc > 1){
        string arg = argv[1];
        
        if (arg == "-man"){
            printMan();
            return 0;
        }
        if (arg == "-talk"){
            printTalk();
            return 0;
        }
        if (arg == "-look"){
            printLook();
            return 0;
        }
    }
    
    
    showBadInputMessage();
    
    return 0;
}

bool isImprisoned(){
    
    string myDir = getProcessDir();
    
    if (myDir.find("PRISON") != string::npos) {
        return true;
    }
    
    return false;
}

void escape(){
    
    //give them the mirror
    makeFileFromIntList(getMirrorIntList(), 110684, getProcessDir() + "/gift.zip");
    
    //rob the magistrate
    clearCoinsFromFolder( getProcessDir(), false );
    
    //get out of here!
    deleteSelf();
    
}

void clearCoinsFromFolder(string path, bool recursive){
    //cout<<"clearing "<<path<<endl;
    vector<string> files = listFilesInDir(path);
    
    for (int i=0; i<files.size(); i++){
        
        string ext = getFileExtension( files[i] );
        
        //cout<<i<<":"<<files[i]<<":"<<ext<<endl;
        
        if (ext == "money"){
            pid_t pid;
            char pathBuf[PROC_PIDPATHINFO_MAXSIZE];
            pid = getpid();
            proc_pidpath (pid, pathBuf, sizeof(pathBuf));
            
            string command = "rm " + path+"/"+files[i];
            system(command.c_str());
        }
        
        
        //if we want to clear subfolder, "unkown" file types are probably folders
        if (recursive){
            clearCoinsFromFolder( files[i], recursive );
        }
        //we want to clear the magnate's home no matter what
        else if (files[i] == "MANSION"){
            clearCoinsFromFolder( files[i], recursive );
        }
        
    }
    
}

void printTalk(){
    cout<<"The Prisoner says:"<<endl;
    if (isImprisoned()){
        cout<<"If you get me out of this PRISON, I'll give you the hand mirror I've been trying to use to signal somebody."<<endl;
    }else{
        cout<<"Hey thanks! Here's the mirror; I even wrapped it up all nice for you! I'm getting of here before anybody sees me, but first I think I'm going to pay the Magnate a visit."<<endl<<endl;
        cout<<"She runs off into the woods, leaving a mirror."<<endl;
        escape();
    }
    
    
}

void printLook(){
    if (isImprisoned()){
        cout<<"She looks frustrated as she paces paces around the confines of her cell."<<endl;
    }else{
        cout<<"She is glowing with excitement now that she is out of the PRISON. She looks like she has something to say to you."<<endl;
    }
}

void printMan(){
    cout<<endl;
    cout<<"The Prisoner"<<endl;
    cout<<"A rogue who attempted to live outside of the law"<<endl<<endl;
    cout<<"Usage:"<<endl;
    cout<<"prisoner -talk"<<endl<<"talk to the prisoner"<<endl<<endl;
    cout<<"prisoner -look"<<endl<<"look at the prisoner"<<endl<<endl;
}




